void history_start(HistoryItem item) {
...
if (history_item_index(item) < 0) {
item.on_create(item.self);
top = history_peek();
top.on_pause(item.self);
if (top.flags & HISTORY_FLAG_NO_HISTORY) {
top.on_destroy(top.self);
history_pop();
}
item.on_resume(item.self);
history_push(item);
return;
}
...}
